// -------------------
// Exported Components
// -------------------

export function FusebitHeroGraphic({ reset, animationOff, onAnimationDone, ...rest }: FusebitHeroGraphicProps) {
  const [frame, setFrame] = useState(animationOff ? lastFrame : 0);
  const [wasReset, setWasReset] = useState(false);

  if (reset && !wasReset) {
    setWasReset(true);
    setFrame(0);
  }

  if (!reset && wasReset) {
    setWasReset(false);
  }

  function onClick() {
    if (frame >= lastFrame) {
      setFrame(0);
    }
  }

  useLayoutEffect(() => {
    let animationFrame: number;
    if (frame < lastFrame) {
      animationFrame = window.requestAnimationFrame(() => setFrame(frame + 1));
    } else if (onAnimationDone) {
      onAnimationDone();
    }
    return () => {
      if (animationFrame) {
        window.cancelAnimationFrame(animationFrame);
      }
    };
  }, [frame]);

  return (
    <Box center middle {...rest} onClick={onClick}>
      <svg width="100%" viewBox="0 0 1097 783" fill="none">
        {true ? screen() : undefined}
        {beforeScreen(frame)}
        {afterScreen()}
        {true ? screenLeftPanel() : undefined}
        {true ? searchBar() : undefined}
        {true ? plant() : undefined}
        {true ? desk() : undefined}
        {true ? user() : undefined}
        {true ? chair() : undefined}
        {true ? thoughtBubble(frame) : undefined}
      </svg>
    </Box>
  );
}
